import React from 'react';
import * as moment from 'moment';
import DateFnsUtils from '@date-io/moment';
import { MuiPickersUtilsProvider } from 'material-ui-pickers';
import { reduxForm } from 'redux-form';
import { SovosPageLayout } from 's1-ui/sovos-global-layout';
import ActionBar from './components/ActionBar/ActionBar';
import LineItemDefault from './components/LineItemDefaults/LineItemDefaults';
import CalculationSetup from './components/CalculationSetup/CalculationSetup';
import taxCalculatorValidate from './taxCalculatorValidate';
import DataPointLineItems from './components/DataPointLineItems';


function TaxCalculatorForm(props) {
  const { handleSubmit, reset } = props;
  return (
    <SovosPageLayout titleElements={ [{ text: 'Taxcalculator' }] }>
      <MuiPickersUtilsProvider utils={ DateFnsUtils }>
        <form onSubmit={ handleSubmit }>
          <ActionBar isHeader={true} onReset={ reset } />
          <CalculationSetup />
          <LineItemDefault />
          <DataPointLineItems />
          <ActionBar isHeader={false} onReset={ reset } />
        </form>
      </MuiPickersUtilsProvider>
    </SovosPageLayout>
  );
}

TaxCalculatorForm.propTypes = {};

const initialValues = {
  docDt: moment(),
  trnDocNum: '',
  txCalcTp: 1,
  currn: 'USD',
  isAudit: false,
  additionalFields: [],
  renderDataPoints :[
    {}
  ]
}

/*console.log('Inittal values = ', initialValues);
console.log('validate ', taxCalculatorValidate(initialValues));*/


const TaxCalculatorFormWithProps = reduxForm({
  form: 'TaxCaculatorForm',
  initialValues,
  validate: taxCalculatorValidate
})(TaxCalculatorForm)


function TaxCalculatorPage() {
  const submit = (values) => {
    console.log('values= ', values);
    alert(JSON.stringify(values, null, 4));
  }
  return (
    <TaxCalculatorFormWithProps onSubmit={ submit } />
  );
}

TaxCalculatorPage.propTypes = {};
TaxCalculatorPage.defaultProps = {};

export default TaxCalculatorPage;
